- TV channels are archived for up to 7 days;
- Search allows you to find and watch films, TV series or TV channels online;
- Pause and rewind movies, reschedule TV series, and include a reminder of your favourite programme on TV;
- Add interesting TV channels to your Favourites for quick access;
- Personalised recommendations to help you find films, series and TV shows on your favourite topics;
- Children's profile and lots of cartoons for all ages;
- Access to films, series and cartoons from the MEGOGO online cinema;
- The Best of TV is a constantly updated collection of interesting films that you can watch for free;
- Thematic selections of serials, movies and cartoons;
- Movie classics, exclusive series premieres, new TV shows from Uzbekistan;
- Many channels are available in HD. Automatic tuning allows you to watch TV, films and serials even at low internet speeds.

Download TelecomTV to all your devices:
- Works on iOS smartphones and tablets;
- TVs with Apple TV;
- In your computer's browser to watch TV online;
- Watch movies, cartoons and TV series on 3 devices at any tariff for free.

Download TelecomTV and watch TV channels of Uzbekistan, TV series, cartoons and movies HD online cinema MEGOGO.
